description:
Drive 130km (80 miles) of track through Austria, Germany and Switzerland, passing through 40 detailed stations, in this tour de force in route design!



The Three Country Corner Route features stunning scenery, accurate country-specific signalling systems and custom objects throughout - this is probably the most realistic and detailed route developed for Train Simulator to date!

Please note that the Three Country Corner route is currently only compatible with versions of Train Simulator 2013 which were automatically upgraded from RailWorks 3/Train Simulator 2012 in September 2012.



Please support the developers and buy some of their content if you can afford it.


Please use the email address for requests and questions and if you want to share an addon with the community then contact us and we will post it on your behalf. If you would like to contribute, please read the Readme.pdf.


